// import logo from './logo.svg';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import RegistrationForm from './components/RegistrationForm.js';

import './App.css';

function App() {
  return (
    <div className="App">
      <Router>
      <Routes>
          <Route path="/registration" element={<RegistrationForm />} />
        </Routes>      </Router>
    </div>
  );
}

export default App;
